        Технические характеристики:


        Шаттл войска радиационной, химической и биологической защиты NT-CBURN BlazeSavior состоит из следующих блоков:


        Общие технические конструкции:

        Корпус и обшивка: Шаттл имеет усиленный корпус и обшивку, спроектированные для защиты от внешних воздействий и обеспечения безопасности экипажа.

        Двигательная система: Шаттл оборудован мощными двигателями, позволяющими быстро достигать заданной цели и маневрировать в различных условиях.

        Система навигации: Для точной навигации и управления маршрутом шаттла установлена современная система навигации и GPS.

        Система коммуникации: Шаттл оснащен передовой системой связи, обеспечивающей связь с базой и другими членами отряда в режиме реального времени.


        Медицинский блок:

        Медицинский блок: Внутри шаттла находится медицинский блок с необходимым оборудованием и лекарствами для оказания первой помощи пострадавшим.

        Блок морга и кримотория: Шаттл оснащен блоком для хранения и утилизации тел по необходимости.

        Блок производства химикатов: Шаттл оборудован блоком для производства химикатов и других химических средств, необходимых для различных операций.


        Блок оружейки: Внутри шаттла размещается специальный блок для хранения и обслуживания оружия и тактического снаряжения, обеспечивая возможность срочного вооружения для оперативных миссий.


        Инженерный блок:

        Инженерный блок: В шаттле предусмотрен инженерный блок для ремонта и обслуживания оборудования.

        Блок системы жизнеобеспечения: Шаттл оборудован блоком системы жизнеобеспечения, который обеспечивает экипажу необходимое количество кислорода и поддерживает комфортные условия внутри шаттла.


        Другие блоки:

        Научный блок: Блок созданный для борьбы с аномалиями возможными на месте вызова.
